    return (
      <section id="about" className="skill">
        <h3>Beautiful & Unique Digital Experiences</h3>
        <div className="skills">
          <div>HTML & CSS</div>
          <div>JavaScript</div>
          <div>ReactJS</div>
        </div>
      </section>
    );
  };
  export default Skills;
